import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import MainResult from './component/MainResult';
function App() {
  return (
    <Router>
      <div>
        <Route path="/" component={MainResult}/>
      </div>
    </Router>
  )
}

export default App;
